import { ListItem, Button, List, ListItemButton, ListItemText, ListSubheader, ThemeProvider, createTheme } from "@mui/material";
import React from "react";

import "./ControlPanel.css"

const theme = createTheme({

    palette: {
        primary: {
            main: '#FEB130',
        },
        secondary: {
            main: '#ff80ab',
        },
    },
})

const ControlPanel = () => {
    const Feature = ["Driving", "Tuning", "Color Selector"]
    return (
        <List class="Navigator" variant="outlined">
            {() => {
                for (let i = 0; i < Feature.length; i++) {
                    <ListItem>
                        <ListItemButton color='primary' href="#simple-list" >
                            <ListItemText color="primary" primary="Driving Mode" />
                        </ListItemButton>
                    </ListItem>
                }
            }}
        </List >
        // </ThemeProvider >

    );
}

export default ControlPanel
